contracts/Test.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract ProphecyJimpsonsTest {
    address public tokenAddress;
    address public owner;
    IERC20 public prophecyToken;
    
    // Test addresses
    address public constant TEST_DEX_POOL = address(0x1234567890123456789012345678901234567890);
    address public constant TEST_CEX = address(0x2234567890123456789012345678901234567891);
    address public constant TEST_USER1 = address(0x3234567890123456789012345678901234567892);
    address public constant TEST_USER2 = address(0x4234567890123456789012345678901234567893);
    
    constructor(address _tokenAddress) {
        tokenAddress = _tokenAddress;
        prophecyToken = IERC20(_tokenAddress);
        owner = msg.sender;
    }
    
    // Test function to check token info
    function getTokenInfo() public view returns (
        uint256 totalSupply,
        uint256 testContractBalance,
        uint256 ownerBalance
    ) {
        totalSupply = prophecyToken.totalSupply();
        testContractBalance = prophecyToken.balanceOf(address(this));
        ownerBalance = prophecyToken.balanceOf(owner);
        return (totalSupply, testContractBalance, ownerBalance);
    }
    
    // Test function to check balances
    function checkBalances(address[] memory addresses) public view returns (uint256[] memory) {
        uint256[] memory balances = new uint256[](addresses.length);
        for(uint i = 0; i < addresses.length; i++) {
            balances[i] = prophecyToken.balanceOf(addresses[i]);
        }
        return balances;
    }
    
    // Test function to transfer tokens
    function testTransfer(address to, uint256 amount) public returns (bool) {
        require(prophecyToken.balanceOf(address(this)) >= amount, "Insufficient balance");
        return prophecyToken.transfer(to, amount);
    }
    
    // Test function to approve and transferFrom
    function testTransferFrom(address from, address to, uint256 amount) public returns (bool) {
        return prophecyToken.transferFrom(from, to, amount);
    }
    
    // Function to approve spending
    function testApprove(address spender, uint256 amount) public returns (bool) {
        return prophecyToken.approve(spender, amount);
    }
    
    // Function to check allowance - fixed parameter name to avoid shadowing
    function checkAllowance(address tokenOwner, address spender) public view returns (uint256) {
        return prophecyToken.allowance(tokenOwner, spender);
    }
    
    // Function to receive ETH
    receive() external payable {}
    
    // Function to withdraw ETH (only owner)
    function withdrawETH() public {
        require(msg.sender == owner, "Only owner");
        payable(owner).transfer(address(this).balance);
    }
    
    // Function to withdraw any ERC20 tokens (only owner)
    function withdrawERC20(address tokenAddr) public {
        require(msg.sender == owner, "Only owner");
        IERC20 token = IERC20(tokenAddr);
        uint256 balance = token.balanceOf(address(this));
        require(balance > 0, "No tokens to withdraw");
        require(token.transfer(owner, balance), "Transfer failed");
    }
    
    // Helper function to get test addresses
    function getTestAddresses() public pure returns (
        address dexPool,
        address cex,
        address user1,
        address user2
    ) {
        return (TEST_DEX_POOL, TEST_CEX, TEST_USER1, TEST_USER2);
    }
}

